import React, { useEffect } from 'react';
import api from '../Config/api';

function Login() {
  const params = {
    email: 'love.puzzling@gmail.com',
    password: '123456',
  };
  const authenticate = async () => {
    api.post('/auth/authenticate', params).then((response) => {
      console.log(response);
    });
  };
  useEffect(() => {
    authenticate();
  });
  return <div>Login teste</div>;
}

export default Login;
